import axios from 'axios';
import React from 'react';

export default class Map3D extends React.Component {
    async componentDidMount(){
        // eslint-disable-next-line no-undef
        var map = new OSMBuildings({ //Definido no script importado no html
            container: 'map3d',
            position: { latitude: -26.913785, longitude: -48.660875 },
            zoom: 16,
            minZoom: 16,
            //maxZoom: 20,
        });
        //console.log(await axios.get('https://tile.openstreetmap.org/16/23910/37858.png'));
        map.addMapTiles('https://tile.openstreetmap.org/{z}/{x}/{y}.png');
        map.addGeoJSONTiles('https://{s}.data.osmbuildings.org/0.2/anonymous/tile/{z}/{x}/{y}.json');
        map.addMarker({latitude: 64.129800, longitude: -21.942068, altitude: 10});
        map.addMarker({latitude: 64.130600, longitude: -21.945268, altitude: 10});
        map.addMarker({latitude: 64.131400, longitude: -21.949068, altitude: 10});
        map.addMarker({latitude: 64.132200, longitude: -21.952868, altitude: 10});
        map.addOBJ(
            'http://localhost:3000/obj/teapot',
            {
                latitude: 64.128701,
                longitude: -21.942068
            },
            {
                scale: 20,
                color: "#222255"
            }
        );
        map.addOBJ(
            'http://localhost:3000/obj/teddybear',
            {
                latitude: 64.128000,
                longitude: -21.938068
            },
            {
                altitude: 160,
                scale: 3,
                color: "#6b602e"
            }
        );
        map.addOBJ(
            'http://localhost:3000/obj/cow',
            {
                latitude: 64.128000,
                longitude: -21.938068
            },
            {
                altitude: 80,
                rotation: 90,
                scale: 20,
                color: "#ffbbdd"
            }
        );
    }

    render(){
        return <>
            <div style={{height: "54vh", width: "50%"}} id="map3d"/>
            <img src={'https://tile.openstreetmap.org/15/23910/37858.png'}></img>
        </>
    }
}
